// ==UserScript==
// @name       Kinoslivki filter
// @namespace  pupsk86
// @version    0.1
// @description  View only films
// @match      http://kinoslivki.ru/*
// @require http://code.jquery.com/jquery-latest.js
// ==/UserScript==

var imgPupsk = '';
var fltPupsk = ":has(tr:contains('сериал')),:has(tr:contains('Сериал')),:has(tr:contains('ТВ шоу')),:has(tr:contains('музыка'))";

function fnPupskHide(e) {
    var selector = (arguments.length==1) ? e.target : ".FilmCell:visible";
    $(selector).filter(fltPupsk).hide();
}

function fnPupsk() {
    $("#btnHide").prop("pressed", !$("#btnPupsk").prop("pressed"));
    if ($("#btnHide").prop("pressed")) { 
        fnPupskHide();
    } else {
        $(".FilmCell:hidden").filter(fltPupsk).show();
    }
}

$(document).ready(function(){
    $("body").append('<div id="btnHide"/>');
    $("#btnHide").on("click", function() {
        $(this).prop("pressed", !$(this).prop("pressed"));
        if ($(this).prop("pressed")) { 
            fnPupskHide();
        } else {
            $(".FilmCell:hidden").filter(fltPupsk).show();
        }
    });
    $("#btnHide").hover( function() { $(this).css("background-position","0 -858px"); },
                        function() { if (!$(this).prop("pressed")) $(this).css("background-position","0 -528px"); }
                       );
    $("#btnHide").css({
        "cursor"     : "pointer" ,
        "position"   : "absolute" ,
        "right"      : "140px" ,
        "top"        : "122px",
        "height"     : "33px",
        "width"      : "33px",
        "background" : "url(data:image/png;base64," + imgPupsk + ") 0px -528px no-repeat transparent"
    });
    $(document).bind("DOMNodeInserted", function (e) { if ($("#btnHide").prop("pressed")) fnPupskHide(e); });
});